import React from 'react';
import {
    Card,
    CardImg,
    CardBody,
    CardTitle,
    CardSubtitle,
    CardText,
    Container,
} from 'reactstrap';

class RecruiterCard extends React.Component {

    constructor(props){
        super(props);

        this.state = {
            modal: false,
        };
    }

    render() {
        console.log(this.props);
        return (
            <div id="recruiter" >
                <Card style={{minWidth:'250px', maxHeight:'300px' , columnGap:'1rem', display: 'block'}}>
                    <div className='d-inline-block' style={{margin:'1rem'}}>
                        <CardImg className='img-fluid rounded-circle' style={{maxWidth:'35%', minWidth: '35%'}} src={'http://192.168.56.101:1337' + this.props.Headshot.url} alt='headshots'/>
                        <CardTitle tag='h6'>{this.props.FirstName} {this.props.LastName}</CardTitle>
                    </div>

                    {/* <div id='calendly' dangerouslySetInnerHTML={{__html:this.props.CalendlyAPIURL}} /> */}
                    {/* <!-- Calendly inline widget begin --> */}
                    <object data="https://calendly.com/isaacpopoola/15min" style={{minWidth:'320px', height:'630px'}}>
                        <embed className="calendly-inline-widget" data-url="https://calendly.com/isaacpopoola/15min" style={{minWidth:'320px', height:'630px'}}></embed>
                        <script type="text/javascript" src="https://assets.calendly.com/assets/external/widget.js"></script>
                    </object>
                    {/* <!-- Calendly inline widget end --> */}
                </Card>
            </div>
        )
    }

}

export default RecruiterCard;
